import pic from "../../assets/pic.jpeg";

interface Props {
  mission: string;
}

const Header: React.FC<Props> = ({ mission }) => {
  return (
    <header className="header">
      <img src={pic} />
      <h1>Daniel Friedebold</h1>
      <h3>Mission: {mission}</h3>
    </header>
  );
};
export default Header;
